独特なデザインで有名な腕時計メーカー『ORIENT／オリエント』50年代に創業し、70年代にはアラーム機能関連の商品を数々ヒットさせたことでも有名です。<br><br>90年代からは、クラシックな機械式時計「オリエントスター」や「ロイヤルオリエント」の復刻をはじめ、精度の高い機械式ムーブメントの開発や、新機能のリザーブメーター（ぜんまいの残量計）などを発表しました。<br><br>斬新なクラッシックなデザイン、独自開発の精度の高い自動巻ムーブメントは、海外での評価も高く、多くのファンに支持されています。

